import React from "react";
import { Link } from "react-router-dom";

function SideBar({user, dispatch }){
  let backgroundColor = "#000"; // Default color for the sidebar

  // Change background color based on user type
  switch (user?.userType) {
    case "patient":
      backgroundColor = "#4169E1"; // Change to yellow for patients
      break;
    case "admin":
      backgroundColor = "#0818A8"; // Change to blue for admins
      break;
    case "doctor":
      backgroundColor = "#0047AB"; // Change to green for doctors
      break;
    default:
      break;
  }
    return (
        <>
          <div className="col-2 p-2" style={{ backgroundColor: backgroundColor, fontSize:"24px", height:"100vh" }}>
              <div className="top_section">
                <h1 className="logo p-3" style={{color: "white"}}>
                  IKAA
                </h1>
              </div>
              <div className="bottomSection">
                <Link className="link" activeclassname="active" to={"/login"}>
                  <div className="icon p-3" style={{color: "white"}}>
                    DashBoard
                  </div>
                </Link>
    
                {user?.userType === "patient" ? (
                  <Link
                    className="link"
                    activeclassname="active"
                    to={"/Pprofile"}
                  >
                    <div className="p-3" style={{color: "white"}}>
                      Profile
                    </div>
                  </Link>
                ) : null}
    
                {user?.userType === "patient" ? (
                  <Link
                    className="link"
                    activeclassname="active"
                    to={"/bookAppointment"}
                  >
                    <div className="p-3" style={{color: "white"}}>
                      Book Appointment
                    </div>
                  </Link>
                ) : null}
                {user?.userType === "admin" ? (
                  <Link className="link" activeclassname="active" to={"/dsignin"}>
                    <div className="p-3" style={{color: "white"}}>
                      Add Doctor
                    </div>
                  </Link>
                ) : null}
                {user?.userType === "admin" ? (
                  <Link className="link" activeclassname="active" to={"/addnurse"}>
                    <div className="p-3" style={{color: "white"}}>
                      Add Nurse
                    </div>
                  </Link>
                ) : null}
                {user?.userType === "admin" ? (
                  <Link className="link" activeclassname="active" to={"/addAdmin"}>
                    <div className="p-3" style={{color: "white"}}>
                      Add Admin
                    </div>
                  </Link>
                ) : null}
    
                {user?.userType === "doctor" ? (
                  <Link
                    className="link"
                    activeclassname="active"
                    to={"/doctorprofile"}
                  >
                    <div className="p-3" style={{color: "white"}}>
                      Profile
                    </div>
                  </Link>
                ) : null}
                {user?.userType === "doctor" ? (
                  <Link
                    className="link"
                    activeclassname="active"
                    to={"/checkappointment"}
                  >
                    <div className="p-3" style={{color: "white"}}>
                      Appointments
                    </div>
                  </Link>
                ) : null}
                {user?.userType === "doctor" ? (
                  <Link
                    className="link"
                    activeclassname="active"
                    to={"/createslip"}
                  >
                    <div className="p-3" style={{color: "white"}}>
                      Create Report
                    </div>
                  </Link>
                ) : null}
                {/* {user?.userType === "doctor" ? (
                  <Link
                    className="link"
                    activeclassname="active"
                    to={"/patientdetails"}
                  >
                    <div className="icon">
                      <TbListDetails className="mainIcon" />
                    </div>
                    <div
                      style={{ display: isOpen ? "block" : "none" }}
                      className="link_text"
                    >
                      Patients
                    </div>
                  </Link>
                ) : null} */}
    
                <Link
                  className="LogOutPath link"
                  onClick={() => {
                    dispatch({ type: "AUTH_LOGOUT" });
                  }}
                  to={"/"}
                >
                  <div className="p-3" style={{color: "white"}}>
                    Logout
                  </div>
                </Link>
              </div>
            </div>
        </>
      );
    };
    
export default SideBar;
